from functools import lru_cache


class ETN(object):
    def __init__(self, left=None, right=None, op=None, val=None):
        self.left = left
        self.right = right
        self.op = op  # False: or True: and
        self.val = val
        self.s_val = None
        if val is not None:
            self.s_val = val

    def __str__(self):
        if self.val is not None:
            return f'ETN {self.val}'
        else:
            if self.op:
                return 'ETN &'
            else:
                return 'ETN |'


def cal_val(node):
    if node.s_val is None:
        if node.val is not None:
            node.s_val = node.val
        else:
            if node.op:
                node.s_val = cal_val(node.left) and cal_val(node.right)
            else:
                node.s_val = cal_val(node.left) or cal_val(node.right)

    return node.s_val


class Solution:
    def minOperationsToFlip(self, expression: str) -> int:
        expression = expression + ')'
        n = len(expression)
        nodes = []
        stack = [nodes]
        for c in expression:
            if c != ')':
                if c == '0' or c == '1':
                    nodes.append(ETN(val=int(c)))
                elif c == '|':
                    nodes.append(ETN(op=False))
                elif c == '&':
                    nodes.append(ETN(op=True))
                else:
                    new_nodes = []
                    nodes.append(new_nodes)
                    stack.append(new_nodes)
                    nodes = new_nodes
            else:
                m = len(nodes)
                last = nodes[0]
                i = 1
                while i < m:
                    x, y, z = last, nodes[i], nodes[i + 1]
                    y.left, y.right = x, z
                    last = y
                    i += 2
                stack.pop()
                if len(stack) > 0:
                    stack[-1][-1] = last
                else:
                    stack.append(last)
                nodes = stack[-1]

        root = stack[0]
        m = cal_val(root)

        @lru_cache(maxsize=None)
        def f(node, val):
            if node.s_val == val:
                return 0
            if node.val is not None:
                return 1

            left, right = node.left, node.right
            ret = n
            for i in range(2):
                for j in range(2):
                    lf, rf = f(left, i), f(right, j)
                    if i | j == val:
                        ret = min(ret, lf + rf + (1 if node.op else 0))
                    if i & j == val:
                        ret = min(ret, lf + rf + (0 if node.op else 1))
            return ret

        return f(root, 1 - m)


